import React from 'react';
import { Link } from 'react-router-dom'
import './Header.scss'

const Header = (props) => {
  return (
    <header>
      <div className="nav-links">
        <ul>
          <li><Link to={'/'}>Home!</Link></li>
          <li><Link to={'/about'}>About!</Link></li>
          <li><Link to={'/projects'}>projects!</Link></li>
        </ul>
      </div>
    </header>
  );
}

export default Header;
